import { ReactSVG } from "react-svg";

const places = {
    place: "London",
    country: "UK",
    coverImg: "https://cdn.londonandpartners.com/-/media/images/london/visit/things-to-do/sightseeing/london-attractions/tower-bridge/tower-bridge-shutterstock-1920x582.jpg?mw=1920&hash=078DDB24AC457E2D8F231FC3E0F7EC55A00C88E3"
}

export default function Place () {
    return (
        <div className="place">
                         <img 
        src= {require("`${places.coverImg}`")}
        alt={places.place}
        />
        </div>
    )
}
